    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT col2 IN ( + 94 * col0 + - + CAST ( + col2 AS INTEGER ) * col1, col0 );
  - name: tab0

outputs:
  - name: q11768.out
    data: |
      15	81	47
      87	21	10
      97	1	99
